{"System":{"EventId":"4104","Version":"1","Channel":"Microsoft-Windows-PowerShell/Operational","ProviderName":"Microsoft-Windows-PowerShell","Computer":"C1P1-ADM01.GAZPROM.LOC","EventRecordID":"48389971","Keywords":"None","Level":"Verbose","Opcode":"15","Task":"2","ProcessID":"14684","ThreadID":"33352","TimeCreated":"1709714563527","UserId":"CNTR\ent-AV.levin"},"EventData":{"MessageNumber":"1","MessageTotal":"1","ScriptBlockText":"function _AutoDiscoverAndConnect ([System.Management.Automation.PSCredential]$Credential, 
