{"System":{"EventId":"4104","Version":"1","Channel":"Microsoft-Windows-PowerShell/Operational","ProviderName":"Microsoft-Windows-PowerShell","Computer":"C1P1-ADM01.GAZPROM.LOC","EventRecordID":"48389975","Keywords":"None","Level":"Verbose","Opcode":"15","Task":"2","ProcessID":"14684","ThreadID":"33352","TimeCreated":"1709714563761","UserId":"CNTR\ent-AV.levin"},"EventData":{"MessageNumber":"1","MessageTotal":"1","ScriptBlockText":"function _GetSites()
{
	$localSite=[System.DirectoryServices.ActiveDirectory.ActiveDirectorySite]::GetComputerSite()
	if ($localSite -eq $null)
	{
		return #no site - no auto discovery
	}
	$siteDN=$localSite.GetDirectoryEntry().DistinguishedName
	$siteList = New-Object System.Collections.ArrayList
	if ($siteDN -ne $null)
	{
		[void] $SiteList.Add($siteDN)
	}
	# DCR 231555: TAp DCR:Respect site-link costs with remote powershell.
	# Now go one level to find adjacent sites based on site link and add them in the site list
	if ($localSite.SiteLinks -ne $null)
	{
		foreach ($siteLink in $localSite.SiteLinks)
		{
			$siteDN = $null
			# block going backwords
			if (($siteLink.Sites[0] -ne $null) -and ($siteLink.Sites[0].Name -ne $localSite.Name))
			{
				$siteDN = $siteLink.Sites[0].GetDirectoryEntry().DistinguishedName
			}
			elseif ($siteLink.Sites[1] -ne $null)
			{
				$siteDN = $siteLink.Sites[1].GetDirectoryEntry().DistinguishedName
			}
			if ($siteDN -ne $null)
			{ 
				[void] $SiteList.Add($siteDN)
			}
		}
	}
	# When no exchange server will be found in the current site or adjacent sites, then we should search in all sites
	[void] $SiteList.Add("*")
	$siteList
}","ScriptBlockId":"835cbd12-1b58-48e4-b92d-84ce4f35c5ca","Path":"C:\Program Files\Microsoft\Exchange Server\V15\bin\ConnectFunctions.ps1"}}

{"System":{"EventId":"4104","Version":"1","Channel":"Microsoft-Windows-PowerShell/Operational","ProviderName":"Microsoft-Windows-PowerShell","Computer":"C1P1-ADM01.GAZPROM.LOC","EventRecordID":"48389988","Keywords":"None","Level":"Verbose","Opcode":"15","Task":"2","ProcessID":"14684","ThreadID":"33352","TimeCreated":"1709714564368","UserId":"CNTR\ent-AV.levin"},"EventData":{"MessageNumber":"1","MessageTotal":"1","ScriptBlockText":"function _NewExchangeRunspace(
				[String]$fqdn, 
				[System.Management.Automation.PSCredential] $credential=$null, 
				[bool]$UseWIA=$true, 
				[bool]$SuppressError=$false,
				$ClientApplication=$null,
				$AllowRedirection=$false,
				[String]$targetServerUriParameter=$null)
{
	$hostFQDN = _GetHostFqdn
	if (($fqdn -ne $null) -and ($hostFQDN -ne $null) -and ($hostFQDN.ToLower() -eq $fqdn.ToLower()))
	{
	    $ServicesRunning = _CheckServicesStarted
	    if ($ServicesRunning -eq $false)
	    {
	        return
	    }
	}
	Write-Verbose ($ConnectFunctions_LocalizedStrings.res_0005 -f $fqdn)
	$so = New-PSSessionOption -OperationTimeout $sessionOptionsTimeout -IdleTimeout $sessionOptionsTimeout -OpenTimeout $sessionOptionsTimeout;
	$setupRegistryEntry = get-itemproperty HKLM:\SOFTWARE\Microsoft\ExchangeServer\v15\Setup -erroraction:silentlycontinue
	if ( $setupRegistryEntry -ne $null)
	{
		$clientVersion = "{0}.{1}.{2}.{3}" -f $setupRegistryEntry.MsiProductMajor, $setupRegistryEntry.MsiProductMinor, $setupRegistryEntry.MsiBuildMajor, $setupRegistryEntry.MsiBuildMinor
		$connectionUri = "http://$fqdn/powershell?serializationLevel=Full;ExchClientVer=$clientVersion"
	}
	else
	{
		$connectionUri = "http://$fqdn/powershell?serializationLevel=Full"
	}

	if ($ClientApplication -ne $null)
	{
		$connectionUri = $connectionUri + ";clientApplication=$ClientApplication"
	}

	if ($targetServerUriParameter -ne $null)
	{
		$connectionUri = $connectionUri + ";TargetServer=$targetServerUriParameter"
	}

	$contents = 'New-PSSession -ConnectionURI "$connectionUri" -ConfigurationName Microsoft.Exchange -SessionOption $so'

	if (-not $UseWIA)
	{
		$contents = $contents + ' -Authentication Kerberos -Credential $credential'
	}
	if ($SuppressError)
	{
		$contents = $contents + ' -erroraction silentlycontinue'
	}
	if ($AllowRedirection)
	{
		$contents = $contents + ' -AllowRedirection'
	}
	[ScriptBlock] $command = $executioncontext.InvokeCommand.NewScriptBlock([string]::join("`n", $contents))
	$session=invoke-command -Scriptblock $command

  if (!$?)
	{
	  # ERROR_ACCESS_DENIED = 5
	  # ERROR_LOGON_FAILURE = 1326
	  if (!(5 -eq $error[0].exception.errorcode) -and
		  !(1326 -eq $error[0].exception.errorcode))
	  {
			#Write-Verbose ($ConnectFunctions_LocalizedStrings.res_0006 -f $fqdn)
			return
	  }
	  else
	  {
	    # no retries if we get 5 (access denied) or 1326 (logon failure)
	    #$REVIEW$ connectedFqdn is not set. Is it okay?
	    break connectScope
	  }
	}
  $session
}","ScriptBlockId":"a9988477-28ac-42d8-93e5-edf3481b1d63","Path":"C:\Program Files\Microsoft\Exchange Server\V15\bin\ConnectFunctions.ps1"}}

{"System":{"EventId":"4104","Version":"1","Channel":"Microsoft-Windows-PowerShell/Operational","ProviderName":"Microsoft-Windows-PowerShell","Computer":"C1P1-ADM01.GAZPROM.LOC","EventRecordID":"48390009","Keywords":"None","Level":"Verbose","Opcode":"15","Task":"2","ProcessID":"14684","ThreadID":"33352","TimeCreated":"1709714565688","UserId":"CNTR\ent-AV.levin"},"EventData":{"MessageNumber":"1","MessageTotal":"1","ScriptBlockText":"function ImportPSSession ([bool]$ClearCache, [switch]$AllowClobber)
{
	if (!($global:remoteSession -eq $null))
	{
	    # do not display all the commands - turn off verbose output
	    set-variable VerbosePreference -value SilentlyContinue

	    $serverName = $global:remoteSession.ComputerName
	    $modulePath = "$env:APPDATA\Microsoft\Exchange\RemotePowerShell\$serverName"
	    $remotePSSettinsPath = "HKCU:Software\Microsoft\ExchangeServer\v15\RemotePowerShell\$serverName"

	    if ($ClearCache)
	    {
	        Write-Host -fore Yellow $CommonConnectFunctions_LocalizedStrings.res_0001
	        ClearRegistryEntryAndModule $remotePSSettinsPath $modulePath
	    }

	    try
	    {
	        if ($AllowClobber)
	        {
	            ExportPSSessionAndImportModule $remotePSSettinsPath $modulePath -AllowClobber
	        }
	        else
	        {
	            ExportPSSessionAndImportModule $remotePSSettinsPath $modulePath
	        }
	    }
	    catch
	    {
	        Write-Warning $CommonConnectFunctions_LocalizedStrings.res_0002
	    }
	    $global:importResults = Get-Module
	    if ($global:importResults -eq $null)
	    {
	        if ($AllowClobber)
	        {
	                $global:importResults=Import-PSSession $global:remoteSession -WarningAction SilentlyContinue -DisableNameChecking -AllowClobber
	        }
	        else
	        {
	                $global:importResults=Import-PSSession $global:remoteSession -WarningAction SilentlyContinue -DisableNameChecking
	        }
	    }
	    set-variable VerbosePreference -value Continue

	    Write-Verbose ($CommonConnectFunctions_LocalizedStrings.res_0003 -f $global:connectedFqdn)
	}
}","ScriptBlockId":"7f899098-7a30-4c21-875e-61e44268b6a0","Path":"C:\Program Files\Microsoft\Exchange Server\V15\bin\CommonConnectFunctions.ps1"}}

{"System":{"EventId":"4104","Version":"1","Channel":"Microsoft-Windows-PowerShell/Operational","ProviderName":"Microsoft-Windows-PowerShell","Computer":"C1P1-ADM01.GAZPROM.LOC","EventRecordID":"48390011","Keywords":"None","Level":"Verbose","Opcode":"15","Task":"2","ProcessID":"14684","ThreadID":"33352","TimeCreated":"1709714565703","UserId":"CNTR\ent-AV.levin"},"EventData":{"MessageNumber":"1","MessageTotal":"1","ScriptBlockText":"function ExportPSSessionAndImportModule ($remotePSSettinsPath, $modulePath, [switch]$AllowClobber)
{
	$hashValue = $global:remoteSession.ApplicationPrivateData.ImplicitRemoting.Hash
	$CurrentUserRemotePSSettings = Get-ItemProperty -path $remotePSSettinsPath -ErrorAction SilentlyContinue

	# PS3.0, Get-ItemProperty will return DWORD data as UInt32, instead of Int32 in PS2.0.
	# If $hashValue is negative, (CurrentUserRemotePSSettings.Hash -ne $hashValue) will always be $true
	# We use bitwise xor operation to work around
	if (($CurrentUserRemotePSSettings -eq $null) `
		-or ($CurrentUserRemotePSSettings.Hash -eq $null) `
		-or (-not ($CurrentUserRemotePSSettings.ModulePath)) `
		-or (($hashValue -bxor $CurrentUserRemotePSSettings.Hash) -ne 0))
	{
		# Redo Everything, when:
		# 1. No registry entry found, or
		# 2. Registry entry exists, but hash value or ModulePath is empty (which is very unlikely) or
		# 3. Hash value of the saved module didn't match with the hash value of the current session
		if ($AllowClobber)
		{
			CreateRegistryEntryAndImportModule $remotePSSettinsPath $hashValue $modulePath -AllowClobber
		}
		else
		{
			CreateRegistryEntryAndImportModule $remotePSSettinsPath $hashValue $modulePath
		}
	}
	else
	{
		$modulePath = $CurrentUserRemotePSSettings.ModulePath
		$module =  Get-ChildItem $modulePath -ErrorAction SilentlyContinue | where-object{$_.Extension -eq ".psm1" -or $_.Extension -eq ".psd1" -or $_.Extension -eq ".ps1xml"}
		if (($module -eq $null) -or ($module.Count -lt 3))
		{
			# If the module folder exists, but any module file is missing, then we should just export the session and import module
			if ($AllowClobber)
			{
				Export-PSSession -Session $global:remoteSession -OutputModule $modulePath -force -AllowClobber | out-null
			}
			else
			{
				Export-PSSession -Session $global:remoteSession -OutputModule $modulePath -force | out-null
			}
			Import-Module -Name $modulePath -ArgumentList $global:remoteSession -DisableNameChecking
		}
		else
		{
			if  ((New-TimeSpan -Start $module[0].LastWriteTime -End (get-date)).TotalHours -gt 72)
			{
				# If the module is expired, then we should redo everything
				if ($AllowClobber)
				{
					CreateRegistryEntryAndImportModule $remotePSSettinsPath $hashValue $modulePath -AllowClobber
				}
				else
				{
					CreateRegistryEntryAndImportModule $remotePSSettinsPath $hashValue $modulePath
				}
			}
			else
			{
				Import-Module -Name $modulePath -ArgumentList $global:remoteSession -DisableNameChecking
			}
		}
	}
}","ScriptBlockId":"f699b68b-3d2d-4b8d-bd6f-82aa8dc29690","Path":"C:\Program Files\Microsoft\Exchange Server\V15\bin\CommonConnectFunctions.ps1"}}

{"System":{"EventId":"4104","Version":"1","Channel":"Microsoft-Windows-PowerShell/Operational","ProviderName":"Microsoft-Windows-PowerShell","Computer":"C1P1-ADM01.GAZPROM.LOC","EventRecordID":"48390017","Keywords":"None","Level":"Verbose","Opcode":"15","Task":"2","ProcessID":"14684","ThreadID":"33352","TimeCreated":"1709714565769","UserId":"CNTR\ent-AV.levin"},"EventData":{"MessageNumber":"1","MessageTotal":"1","ScriptBlockText":"function CreateRegistryEntryAndImportModule ($remotePSSettinsPath, $hashValue, $modulePath, [switch]$AllowClobber )
{
	ClearRegistryEntryAndModule $remotePSSettinsPath $modulePath
	new-item $remotePSSettinsPath -force | out-null
	New-ItemProperty -Path $remotePSSettinsPath -Name Hash -Value $hashValue -PropertyType DWord -force | out-null
	New-ItemProperty -Path $remotePSSettinsPath -Name ModulePath -value $modulePath -PropertyType ExpandString -force | out-null
	if ($AllowClobber)
	{
		Export-PSSession -Session $global:remoteSession -OutputModule $modulePath -force -AllowClobber | out-null
	}
	else
	{
		Export-PSSession -Session $global:remoteSession -OutputModule $modulePath -force | out-null
	}
	Import-Module -Name $modulePath -ArgumentList $global:remoteSession -DisableNameChecking
}","ScriptBlockId":"fdac912c-a4c6-4204-8e02-1c259e0dc6d3","Path":"C:\Program Files\Microsoft\Exchange Server\V15\bin\CommonConnectFunctions.ps1"}}

